module.exports = {
  upload: function(req, res) {
    var uploadFile;
    uploadFile = req.file('uploadFile');
    console.log(uploadFile);
    return uploadFile.upload(function(err, files) {
      if (err) {
        return res.serverError(err);
      }
      console.log(files);
      res.json({
        status: 200,
        file: files
      });
    });
  }
};
